--Arithmitic & Logical Operators

    --retrive all hospitals having more than or equal to 8 rooms and are covid dedicated
    select * from hospital
      where rooms >= 8 
        and covid = 'Yes' 
          order by rooms asc;

    --retrieve all non-covid hospitals having even number of rooms
    select * from hospital 
      where mod(rooms,2)=0 
        and covid like '%No%' 
          order by rooms asc;

    --retrieve all medicines which will expire before 11-06-2022
    select * from medicines 
      where bestbefore<'11-06-2022';

    --retrieve name of all male patients
    select fname,mname,lname 
      from patients
        where gender='F';
    
    --display all patients who are treated by doctor with qualification of MD
    select patient.* 
      from patient,treats,doctor 
        where patient.pid=treats.patientid 
          and treats.doctorid=doctor.doctorid
            and doctor.qualification='MD';
    
--Aggregate functions(different Clauses and Functions)
    
    --retrieve total no of patients assigned to doctor 10
    select count(*) 
      from patient,treats,doctor 
        where patient.pid=treats.patientid 
          and treats.doctorid=doctor.doctorid 
            and doctor.doctorid=10;
    
    --calculate percentage of covid positive people from tests
    select distinct(
      100*(select count(*) from tests where status='Positive')/(select count(*) from tests)
        ) from tests;

    --retrieve total number of rooms in hospitals
    select sum(rooms) 
      from hospital;
    
    --retrieve average rooms per hospital
    select avg(rooms) 
      from hospital;
    
    --retrieve hospital having maximum doctors
    select * from hospital
      where hospitalid = (select max(hid) from
        (select hid,count(did) from hospital,worksat 
          where hospital.hospitalid=worksat.hid 
            group by worksat.hid order by hid));
    
    --retrieve hospital with least test positive
    select * from hospital 
      where hospitalid = (select min(hid) from
        (select hid,count(status) from hospital,tests 
           where hospital.hospitalid=tests.hid 
             and status like 'Positive' 
               group by tests.hid order by hid));
       
--Group By
       
    --for each hospital display the number of tests conducted by that hospital
    select hospital.name,count(*) 
      from hospital,tests 
        where hospital.hospitalid=tests.hid 
          group by tests.hid,hospital.name
            order by hospital.name asc;
            
    --show total patient from each town
    select count(*),city from patient
      group by city;
      
    --show total beds in Different wards
    select count(*),ward from beds
      group by ward;
      
    --show all city having more than 25 hospitals
    select count(*),city from hospital
      group by city
        having count(hospitalid) > 25;
        
            

--Views

    --retrieve 4th oldest nurse
    select distinct * 
      from nurse n1 where 
        (3)=any (
          select count(n2.dob) 
            from nurse n2 where
              n2.dob < n1.dob
        );

    --retrieve the 5th oldest patient
    select distinct *
      from patient p1 where 
        (4)=any (
          select count(p2.dob) 
            from patient p2 where
              p2.dob < p1.dob
        );
          
    --retrieve number of beds having lack of oxygen
    select count(*) 
      from beds 
        where oxygenstatus like '%Unavailable%';
    
    --retrieve names of doctor who prescribes medicine Homoslate
    select doctor.doctorid 
      from doctor,medicines,gives 
        where doctor.doctorid=gives.doctorid
         and gives.medid=medicines.medid
           and medicines.name like '%Homoslate%'; 
         
    --retrieve nurse assigned to bedid 54
    select distinct nurse.*
      from nurse,assigned 
        where nurse.nurseid=assigned.bedid 
          and assigned.bedid=54; 
    
    --retrieve 2nd most infant covid positive patient
    select * from patient p1 
      where 
      (1)=any (select count(p2.dob)
        from patient p2 where
          p2.dob > p1.dob);
    

--SET THEORY

    --retrieve all data of tests conducted at city Hubli and are negative
    select tests.* from tests 
      inner join hospital on tests.hid=hospital.hospitalid 
        where hospital.city='Hubli' 
          and tests.status='Negative' 
            order by hid;

    --retrieve all data of patients at city Bangalore who were born after 2004
    select patient.* from patient 
      inner join hospital on patient.hid=hospital.hospitalid 
        where hospital.city='Bangalore' 
          and dob > '31-12-04' order by hid;
    
    
    --retrieve all doctors who works atleast at one hospital
    select doctor.* from doctor where doctorid in 
      (select worksat.hid from worksat
        inner join doctor on worksat.hid = doctor.doctorid);
          
--Index          

    create index ppatient
        on patient (pid,fname);
    drop index ppatient;
    
    




